      SELECT DISTINCT + + col1 / + ( - 70 ) + col1 + + col2 / + col0 AS col1 FROM tab0 (FORMAT parquet) cor0 WHERE - col2 BETWEEN - - col1 AND NULL;
  - name: tab0

outputs:
  - name: q6452.out
    data: |
